import styled from 'styled-components';

export const StyledWatch = styled.div`
  width: 100%;
  height: 100vh;

  video {
    width: 100%;
    height: 100%;
  }
`;

export const BackArrow = styled.div`
  position: absolute;
  display: flex;
  align-items: center;
  color: #fff;
`;
